Recipients of NIHR Proposal and Partnership Development (PPDA) Awards are funded subject to the following conditions being met:
a)	The Award may only be used in accordance with the plans outlined in the application submitted to the PPD fund in order to pay for: (i) reasonable travel and subsistence expenses; and/or (ii) reasonable partnership formation and development costs to support the production of related memorandum(s) of understanding and/or draft governance policies between the relevant oversea partner(s), collaborator(s) and/or service provider(s); both for the purposes of supporting the funding application to the National Institute for Health and Care Research (NIHR) Research on Interventions for Global Health Transformation (RIGHT)programme.
b)	No variation to the plans outlined in the application to the PPD fund is permitted without the prior written consent of the NIHR; 
c)	In the event that VAT or any other tax or duty is payable in respect of the Award or the use of the Award, such VAT, tax or duty shall be payable by the Award holder; 
d)	In using the Award and before making any payment to a local partner, collaborator or service provider, the Award holder must complete appropriate due diligence and take all steps reasonably necessary to ensure that both Award holder and their local partners, collaborators and/or service providers comply with all directly applicable legislation including (but not limited to), anti-bribery and corruption, the NIHR Policy on Preventing Harm in Research and NIHR Safeguarding Guidance; 
e)	The Award holder must provide updates on how you have spent and/or plan to spend the Award as required by DHSC; 
f)	In the event that any part of the award is not applied as outlined in your application, you will repay the relevant amount to the Department of Health and Social Care (DHSC) at the DHSCs request; and 
g)	The Award holder will provide verbal or written reports as required by DHSC on any aspect of the use of the Award.
